goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.constants.Severity");goog.require("axs.utils");axs.AuditRules.addRule({name:"ariaOwnsDescendant",heading:"aria-owns should not be used if ownership is implicit in the DOM",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_aria_06",severity:axs.constants.Severity.WARNING,relevantElementMatcher:function(element){return axs.browserUtils.matchSelector(element,"[aria-owns]")},test:function(element){var attr="aria-owns",ownedElements=axs.utils.getIdReferents(attr,element);return ownedElements.some(function(ownedElement){return element.compareDocumentPosition(ownedElement)&Node.DOCUMENT_POSITION_CONTAINED_BY})},code:"AX_ARIA_06"});